import SignUp from '../components/SignUp'
import Styled from 'styled-components'

const Columns = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  grid-gap: 20px;
`

const signupPage = () => {
  return (
    <div>
      <SignUp />
      <SignUp />
      <SignUp />
    </div>
  );
};

export default signupPage;
